All the openscad code is in <a rel="nofollow" href="https://github.com/elmom/scad" >https://github.com/elmom/scad</a> ATM. The files here might not be the latest! The code uses the MCAD lib, which comes with the code if you just do a 'git clone git://github.com/elmom/scad.git'. Of course you can get them separately too: <a rel="nofollow" href="https://github.com/elmom/MCAD" >https://github.com/elmom/MCAD</a>
An instructional 3D model is uploaded too. It might not make much sense, please comment :). More photos here: <a rel="nofollow" href="http://picasaweb.google.com/tuorepuristettu/Hydroponics" >http://picasaweb.google.com/tuorepuristettu/Hydroponics</a>
Info for the plant-holder from the code:<br />
&quot;<br />
// This is a holder for plants, to be used for indoor gardening.<br />
// Idea is from the zengrow.com systems.
// This should hold the plants in holes made to the lid (or other sheet)<br />
// of a water container. A pump pumps the water through a tube, and the<br />
// other end of the tube is held over the plant. The water then returns<br />
// to the container after passing the plant's roots.<br />
&quot;
You will need the container (ask for large used food containers from the local bakery etc.): height 15-25cm, the other dimensions at least 25cmx25cm (about 10-30 litres). Then a pump (buy from zengrow.com or find some aquarium pump), some tubing (about 10mm ID) and a water divider (see the printable tube connector). You can then grow stuff from seeds or make your store bought veggies grow some more. A sponge like growing media (as available from zengrow.com) is better than dirt, but some kind of gravel might work too.
For year round farming in most areas a proper lamp is a must. The ones from zengrow.com are good, but anything with similar specs should work.
